import React from "react";
import axios from "axios";

export const Reference = () => {
  let contentName = window.location.pathname;
  console.log(`${process.env.REACT_APP_PUBLIC_URL}/${contentName}`)

  axios.get(`${process.env.REACT_APP_PUBLIC_URL}/${contentName}`)
  .then(response => {
    response.forEach(element => {
      console.log(element.name)
    });
  })
  return <h1>Home</h1>;
};
